"<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nI think this website's really great. I'm glad Kyle got in touch with my brother, sister, and I. We never knew we had much extended family!  :-)<br />\nProbably my mom, Vicki Rowan Carlson, my Uncle Shawn Rowan and my Uncle Ted Rowan. They are all first cousins with your father, Michael (i think). So that makes us second cousins (i think).<br />\nSo, the children that I met at Ted Rowan's house were...<br />\nmy father is tom rowan. he would be your great uncle. my father was<br />\nyour grandfather's brother. my son is kyle green.<br />\nMy grandfather, Ted Rowan, owned a flower shop.<br />\nI think I remember visiting your house when I was very young. Did your father own a flower shop?<br />\ncoll<br />\nThanks! I think our grandfathers are brothers. My mom is Vicki Rowan (Ted Rowan's daughter). Colin and Conor Rowan are my first cousins. I think you are my second cousin. I didn't know I had this big of a family until Kyle Green invited me to this tree! :-)<br />\nNice picture. I have a son named Colin but his last name is Kosinski--my maiden name is Rowan.\n</p>\n<p>\nHow are you related? \n</p>\n<p>\nColleen\n</p>\n</div>\n</div>",
"",
"",
